// Get API Key
let STRIPE_PUBLISHABLE_KEY = document.currentScript.getAttribute('STRIPE_PUBLISHABLE_KEY');

// Create an instance of the Stripe object and set your publishable API key
const stripe = Stripe(STRIPE_PUBLISHABLE_KEY);

// Select subscription form element
const subscrForm = document.querySelector("#subscrForm"); // Get Id Form

// Attach an event handler to subscription form
subscrForm.addEventListener("submit", handleSubscrSubmit);

let elements = stripe.elements();
var style = {
  base: {
    lineHeight: "3rem",
    fontSize: "1.6rem",
    border: "1px solid #ced4da",
  }
};
let cardElement = elements.create('card', {style: style});
cardElement.mount('#card-element');
cardElement.on('change', function (event){
  displayError(event);
});

function displayError(event){
  if (event.error) {
    showMessage(event.error.message);
  }
}

async function handleSubscrSubmit(e){
  e.preventDefault();
  setLoading(true);
  let subscr_plan_id = document.getElementById("subscription_plan").value;
  let customer_name = document.getElementById("name").value;
  let customer_email = document.getElementById("email").value;

  // Post the subscription info to the server-side script
  fetch("payment_init.php",{
    method: "POST",
    headers: {"Content-Type": "application/json"},
    body: JSON.stringify({ request_type:'create_customer_subscription', subscr_plan_id:subscr_plan_id,
    name:customer_name, email:customer_email })
  })
  .then(response => response.json())
  .then(data => {
     if (data.subscriptionId && data.clientSecret) {
       paymentProcess(data.subscriptionId, data.clientSecret, data.customerId);
     }else{
       showMessage(data.error);
     }
     setLoading(false);
  })
  .catch(console.error);
}

function paymentProcess(subscriptionId, clientSecret, customerId){
  let subscr_plan_id = document.getElementById("subscription_plan").value;
  let customer_name = document.getElementById("name").value;
  // Create payment method and confirm payment intent
  stripe.confirmCardPayment(clientSecret,{
    payment_method : {
        card : cardElement,
        billing_details : {
          name : customer_name,
        }
    }
  }).then((result) =>{
    if (result.error) {
      showMessage(result.error.message);
      setLoading(false);
    }else{
      /*
      * successful subscription payment
      * Post the transaction info to the server-side script and redirect to the payment status page
      */
      fetch("payment_init.php",{
         method : "POST",
         haders : {"Content-Type": "application/json"},
         body : JSON.stringify({ request_type:'payment_insert', subscription_id:subscriptionId, customer_id:customerId,
         subscr_plan_id:subscr_plan_id, payment_intent:result.paymentIntent})
      })
      .then(response => response.json())
      .then(data => {
         if (data.payment_id) {
           window.location.href = 'payment_status.php?sid='+data.payment_id;
         }else{
           showMessage(data.error);
           setLoading(false);
         }
      })
      .catch(console.error);

    }
  });
}

// Display message
function showMessage(messageText){
  const messageContainer = document.querySelector("#paymentResponse");

  messageContainer.classList.remove("hidden");
  messageContainer.textContent = messageText;

  setTimeout(function(){
    messageContainer.classList.add("hidden");
    messageText.textContent = "";
  }, 5000);
}

// Show a spinner on payment submission
function setLoading(isLoading){
  if (isLoading) {
    // Disable the button and show spinner
    document.querySelector("#submitBtn").disabled = true;
    document.querySelector("#spinner").classList.remove("hidden");
    document.querySelector("buttonText").classList.add("show");
  }else{
    // Enable the button and hidde spinner
    document.querySelector("#submitBtn").disabled =false;
    document.querySelector("#spinner").classList.add("show");
    document.querySelector("buttonText").classList.remove("hidden");
  }
}

function solve() {
    const cellLength = 3
    const fieldRows = Array.from(document.querySelectorAll("#exercise tbody tr"))
    const [checkButton, clearButton] = document.querySelectorAll("tfoot button")
    const tableElement = document.querySelector("table")
    const pElement = document.querySelector("div#check p")
    checkButton.addEventListener("click", solutionCheck)
    clearButton.addEventListener("click", clear)

    function getCells() {
        let field = Array(~~(fieldRows.length / cellLength)).fill().map(() => [])
        fieldRows.forEach(row => {
            row = Array.from(row.querySelectorAll("td > input"))
            for (let i = 0; i < row.length; i += cellLength) {
                field[i / cellLength].push(row.slice(i, i + cellLength))
            }
        })
        field = field.reduce((prev, column) => {

            const cells = column.reduce((p, c) => {
                if (!p.length || p[p.length - 1].length === 3) p.push([])
                p[p.length - 1].push(c)
                return p
            }, [])
            prev.push(cells)
            return prev
        }, [])
        return field
    }

    function isCellSolved(cell) {
        for (let i = 1; i <= Math.trunc(fieldRows.length / cellLength) * cellLength; i++) {

            if (!cell.some(row => row.includes(i.toString()))) {
                return false

            }
        }
        return true
    }

    function isSolved() {
        const checkCells = getCells().every(column => {
            return column.every(cell => {
                cell = cell.map(element => element.map(el => el.value))
                return isCellSolved(cell)
            })
        })
        const cols = []
        const checkRows = fieldRows.every(row => {
            row = Array.from(row.querySelectorAll("td > input"))
            row = row.reduce((p, n) => {
                p.push(n.value);
                return p
            }, [])
            if (!cols.length) cols.push(...Array(row.length).fill(1).map(() => []))
            row.forEach((v, idx) => cols[idx].push(v))
            return isCellSolved(row)
        })
        const checkCols = cols.every(col => {
            return isCellSolved(col)
        })
        return [checkCells, checkRows, checkCols].every(a => a)
    }

    function solutionCheck() {
        const solved = isSolved()
        if (solved) {
            tableElement.style.border = "2px solid green"
            pElement.textContent = "You solve it! Congratulations!"
            pElement.style.color = "green"
        } else {
            tableElement.style.border = "2px solid red"
            pElement.textContent = "NOP! You are not done yet..."
            pElement.style.color = "red"
        }
    }

    function clear() {
        tableElement.style.border = "none"
        pElement.textContent = ""
        getCells().forEach(column => {
            column.forEach(cell => {
                cell.forEach(row => {
                    row.forEach(inp => {
                        inp.value = ""
                    })
                })
            })
        })
    }

    this.sudokuPopulate = function (arr) {
        const fields = Array.from(document.querySelectorAll("table tbody tr td input"))
        for (let i = 0; i < arr.length; i++) {
            fields[i].value = arr[i]
        }
    }

}

