#include <SoftwareSerial.h>

SoftwareSerial obd(2, 3); // RX, TX

void setup() {
  Serial.begin(9600);
  obd.begin(38400);

  // Mengirim perintah untuk membaca data RPM mesin (mode 01, PID 0C)
  sendData("010C");
  // Mengirim perintah untuk membaca data Engine Brake (mode 01, PID 4C)
  sendData("014C");
  // Mengirim perintah untuk membaca data Konsumsi Bahan bakar (mode 01, PID 5E)
  sendData("015E");
  // Mengirim perintah untuk membaca data Level Bahan Bakar (mode 01, PID 2F)
  sendData("012F");
  // Mengirim perintah untuk membaca data Tegangan Aki (mode 01, PID 42)
  sendData("0142");
  // Mengirim perintah untuk membaca Kode Kesalahan Diagnostik (DTC)
  sendData("03");
}

void loop() {
  readData();
}

void sendData(String command) {
  obd.print("01");
  obd.println(command);
}

void readData() {
  if (obd.available() > 0) {
    String response = obd.readStringUntil('\r'); // Membaca response dari ELM327

    // Mengekstrak dan menampilkan nilai RPM
    if (response.indexOf("41 0C") != -1) {
      int rpm = extractData(response, 6) / 4;
      Serial.print("RPM: ");
      Serial.println(rpm);
    }

    // Mengekstrak dan menampilkan nilai Engine Brake
    if (response.indexOf("41 4C") != -1) {
      int engineBrake = extractData(response, 6);
      Serial.print("Engine Brake: ");
      Serial.println(engineBrake);
    }

    // Mengekstrak dan menampilkan nilai Konsumsi Bahan Bakar
    if (response.indexOf("41 5E") != -1) {
      float fuelConsumption = extractData(response, 6) / 20.0;
      Serial.print("Fuel Consumption: ");
      Serial.print(fuelConsumption, 1);
      Serial.println(" L/100km");
    }

    // Mengekstrak dan menampilkan Level Bahan Bakar
    if (response.indexOf("41 2F") != -1) {
      int fuelLevel = extractData(response, 6) * 100 / 255;
      Serial.print("Fuel Level: ");
      Serial.print(fuelLevel);
      Serial.println("%");
    }

    // Mengekstrak dan menampilkan Tegangan Aki
    if (response.indexOf("41 42") != -1) {
      float voltage = extractData(response, 6) / 1000.0;
      Serial.print("Battery Voltage: ");
      Serial.print(voltage);
      Serial.println(" V");
    }

    // Mengekstrak dan menampilkan Kode Kesalahan Diagnostik (DTC)
    if (response.startsWith("43")) {
      response.remove(0, 2);
      while (response.length() >= 4) {
        String dtc = response.substring(0, 4);
        Serial.print("DTC: ");
        Serial.println(dtc);
        response.remove(0, 4);
      }
    }
  }
}

int extractData(String response, int index) {
  String dataHex = response.substring(index, index + 4);
  return (int)strtol(dataHex.c_str(), NULL, 16);
}

#include <algorithm>
#include <iostream>
#include <tuple>
#include <unordered_set>
#include <vector>

using namespace std;

struct Bridge {
    Bridge(int node1, int node2) : node1_(min(node1, node2)), node2_(max(node1, node2)) {}
    int node1_;
    int node2_;
};

bool operator==(const Bridge& lhs, const Bridge& rhs) {
    return lhs.node1_ == rhs.node1_ && lhs.node2_ == rhs.node2_;
}

class Dsu {
public:
    Dsu(int size) : parents(size) {
        for (int i = 0; i < parents.size(); ++i) {
            parents[i] = -1;
        }
    }

    bool IsInSameComponent(int u, int v) { return Parent(u) == Parent(v); }

    int Parent(int idx) {
        if (parents[idx] < 0)
            return idx;
        return parents[idx] = Parent(parents[idx]);
    }

    void Union(int u, int v) {
        if (IsInSameComponent(u, v))
            return;

        int pu = Parent(u);
        int pv = Parent(v);
        if (parents[pu] > parents[pv])
            swap(pu, pv);
        parents[pu] += parents[pv];
        parents[pv] = pu;
    }

private:
    vector<int> parents;
};

void Dfs(const vector<vector<int>>& edges, vector<bool>& is_visited,
    unordered_set<Bridge>& result, int node1, int parent, int& time, vector<int>& enter, vector<int>& ret) {
    is_visited[node1] = true;
    time++;
    enter[node1] = time;
    ret[node1] = time;
    for (int node2 : edges[node1]) {
        if (node2 == parent) continue;
        if (is_visited[node2]) {
            ret[node1] = min(ret[node1], enter[node2]);
            continue;
        }
        Dfs(edges, is_visited, result, node2, node1, time, enter, ret);
        ret[node1] = min(ret[node1], ret[node2]);
        if (enter[node1] >= ret[node2]) continue;
        result.insert({ node1, node2 });
    }
}

int main() {
    ios::sync_with_stdio(0);
    cin.tie(0);

    int nodes_count, edges_count, requests_count;
    cin >> nodes_count >> edges_count >> requests_count;
    vector<vector<int>> edges(1 + nodes_count);
    for (int i = 0; i < edges_count; ++i) {
        int node1, node2;
        cin >> node1 >> node2;
        edges[node1].push_back(node2);
        edges[node2].push_back(node1);
    }

    vector<bool> is_visited(1 + nodes_count, false);
    vector<int> enter(1 + nodes_count);
    vector<int> ret(1 + nodes_count);
    unordered_set<Bridge> result;
    int time = 0;
    for (int i = 1; i < is_visited.size(); ++i) {
        if (is_visited[i]) continue;
        Dfs(edges, is_visited, result, i, -1, time, enter, ret);
    }

    Dsu dsu(nodes_count + 1);
    for (int u = 0; u < edges.size(); ++u) {
        for (auto v : edges[u]) {
            if (result.count({ u, v }) || result.count({ v, u })) continue;

            dsu.Union(u, v);
        }
    }

    for (int i = 0; i < requests_count; ++i) {
        int u, v;
        cin >> u >> v;
        if (dsu.IsInSameComponent(u, v)) {
            cout << "YES\n";
        }
        else {
            cout << "NO\n";
        }
    }
    return 0;
}
