              );
          })
          .on("mousemove", function () {
            tooltip.style("left", event.pageX + 10 + "px");
          })
          .on("mouseout", function () {
            tooltip.style("visibility", "hidden");
          });

        // 6. Finalize chart by adding title, axes labels and legend
        
        //X-axis label
        svg
          .append("text")
          .attr("x", margin.left + (width - margin.left - margin.right) / 2)
          .attr("y", height - margin.bottom / 5)
          .attr("class", "label")
          .text("Year");


        //Y-axis label
        svg
          .append("text")
          .attr("y", margin.left / 4)
          .attr("x", -height / 2)
          .attr("transform", "rotate(-90)")
          .attr("class", "label")
          .text("Time to finish");

        
        svg
          .append("text")
          .attr("x", margin.left + (width - margin.left - margin.right) / 2)
          .attr("y", margin.top / 2.6)
          .attr("id", "title")
          .text("Doping in professional bike racing");
        
        
        svg
          .append("text")
          .attr("x", margin.left + (width - margin.left - margin.right) / 2)
          .attr("y", margin.top / 1.4)
          .text("35 fastest times to finish Alpe d'Huez")
          .style("font-size", "16px")
          .style("text-anchor", "middle");

        //Chart Legends
        svg
          .selectAll("legendSymbols")
          .data(legendKeys)
          .enter()
          .append("circle")
          .attr("cx", width - margin.right - 200)
          .attr("cy", (d, i) => 150 + i * 25)
          .attr("r", 5)
          .attr("fill", (d, i) => colors[i]);

        svg
          .selectAll("legendTexts")
          .data(legendKeys)
          .enter()
          .append("text")
          .text((d) => d)
          .attr("x", width - margin.right - 200 + 15)
          .attr("y", (d, i) => 150 + i * 25 + 5)
          .attr("class", "textbox");

        const legend = svg
          .append("rect")
          .attr("x", width - margin.right - 200 - 15)
          .attr("y", 150 - 5 - 10)
          .attr("rx", 5)
          .attr("ry", 5)
          .attr("width", 195)
          .attr("height", 55)
          .attr("id", "legend");

        // Annotations
        const annotations = [
          {
            note: {
              label: "Significant doping allegations",
              title: "Doping Highlight",
              wrap: 200
            },
            color: ["red"],
            x: xScale(1995),
            y: yScale(parseTime("36:50")),
            dy: -100,
            dx: -100,
            subject: {
              radius: 25,
              radiusPadding: 5
            },
            type: d3.annotationCalloutCircle
          }
        ];

        const makeAnnotations = d3.annotation().annotations(annotations);
        svg.append("g").call(makeAnnotations);
      });
    </script>
  </body>
</html>
